&lt;p&gt;एक शब्द को&amp;nbsp;संख्याओं के सिर्फ एक समूह द्वारा प्रदर्शित किया गया है, जो विकल्पों में दिए गए हैं। विकल्पों में दिए गए संख्याओं के समूह, दो प्रकार के अक्षरों द्वारा प्रदर्शित किए गये हैं, जो कि नीचे दिए दो आव्यूहों में दिए गए हैं।&amp;nbsp;&lt;strong&gt;आव्यूह- I&lt;/strong&gt; के स्तंभ और पंक्तियों को 0 से 4 तक अंकित किया गया है&amp;nbsp;और &lt;strong&gt;आव्यूह- II&lt;/strong&gt; के स्तंभ और पंक्तियों को 5 से 9 तक अंकित किया गया है|&amp;nbsp;दोनों&amp;nbsp;आव्यूहों&amp;nbsp;के वर्णाक्षरों को पहले पंक्ति से&amp;nbsp;और फिर स्तंभ से&amp;nbsp;प्रदर्शित किया जाता है। उदाहरण के लिए &amp;lsquo;L&amp;rsquo; को 22, 43 आदि के द्वारा प्रदर्शित किया जा सकता है और &amp;lsquo;K&amp;rsquo; को 75, 97 आदि के द्वारा प्रदर्शित किया जा सकता है। इसी प्रकार, आपको प्रश्न में &amp;lsquo;PACK&amp;rsquo; शब्द के लिए संख्याओं के समूह को पहचानना है।&lt;/p&gt;

